import React from 'react';

const Overview = ({ appraisal }) => {
  return (
    <div className="p-6 rounded-xl bg-blue-50 shadow-lg text-center">
      <h2 className="text-2xl font-bold text-blue-900 mb-4">
        This is where the agent's thought process will go.
      </h2>
      {appraisal && (
        <div className="mt-4 text-left">
          <h3 className="text-lg font-semibold mb-2">Property Details:</h3>
          <ul className="space-y-1 text-sm">
            <li><strong>Address:</strong> {appraisal.address}</li>
            <li><strong>Bedrooms:</strong> {appraisal.bedrooms || 'N/A'}</li>
            <li><strong>Bathrooms:</strong> {appraisal.bathrooms || 'N/A'}</li>
            <li><strong>Property Type:</strong> {appraisal.property_type || 'N/A'}</li>
            <li><strong>Floor Area:</strong> {appraisal.floor_area ? `${appraisal.floor_area} sq ft` : 'N/A'}</li>
            <li><strong>Status:</strong> {appraisal.status}</li>
          </ul>
        </div>
      )}
    </div>
  );
};

export default Overview;
